const ViewBookings = async (req, res) => {
    try {
        const bookings = await Booking.find({ userId: req.params.uid }).populate("serviceId");
        if (bookings.length > 0) {
            res.status(200).json({
                success: true,
                bookings
            });
        } else {
            throw new Error("No Bookings Found !")
        }
    } catch (e) {
        res.status(200).json({
            success: false,
            message: e.message
        });
    }
}

const purchaseWithCredit = async (req,res) =>{
    try{
        const service = await serviceModel.findById(req.params.sid);
        if(service){
            const usr = await user.findById(req.params.uid);
            if(usr){
                const reqcredits = Math.round(Math.round((Number(service.price) / 1999) * 100)/100);
                if(reqcredits <= usr.Credits){
                    usr.Credits = usr.Credits - reqcredits;
                    await usr.save().then(dta=>{
                        res.status(200).json({
                            success:true,
                            message:"Credits Deducted !"
                        });
                    }).catch(err=>{
                        throw new Error(err.message);
                    })
                }else{
                    throw new Error("Not Enough Credits !");
                }
            }else{
                throw new Error("user not Found !");
            }
        }else{
            throw new Error("service not Found !");
        }
    }catch(err){
        res.status(200).json({
            success:false,
            message:err.message
        });
    }
}

module.exports = { AddBooking, ViewBooking, ConfirmBooking, CheckAvailability, ViewBookings, purchaseWithCredit };